import "./AppFilter.css";

const AppFilter = () => {
  return (
    <div className="btn-group">
      <button className="btn btn-dark" type="button">
        Barcha kinolar
      </button>
      <button className="btn btn-dark btn-outline-dark" type="button">
        Mashhur kinolar
      </button>
      <button className="btn btn-dark btn-outline-dark" type="button">
        Eng ko'p ko'rilgan kinolar
      </button>
    </div>
  );
};

export default AppFilter;
